import { FunctionComponent ,useEffect} from "react";
import Navbar from "../components/navbar";

const SignUpPage: FunctionComponent = () => {

  useEffect(() => {

  // Select the signup button by its id
const signupButton = document.getElementById("signupButton")!; // Use non-null assertion here

// Add an event listener to the button
signupButton.addEventListener("click", () => {
  // Prevent multiple clicks by disabling the button
  signupButton.disabled = true;

  // Fetch input details
  const nameInput = document.getElementById("name") as HTMLInputElement; // Typecast to HTMLInputElement
  const emailInput = document.getElementById("email") as HTMLInputElement; // Typecast to HTMLInputElement
  const passwordInput = document.getElementById("pass") as HTMLInputElement; // Typecast to HTMLInputElement

  // Get input values using non-null assertion
  const name = nameInput.value!;
  const email = emailInput.value!;
  const password = passwordInput.value!;

  // Prepare the data to send to the server
  const data = {
    name,
    email,
    password,
  };

  // Make a POST request to your server to register the user
  fetch("/user/register", {
    method: "POST",
    headers: {
      "Content-Type": "application/json",
    },
    body: JSON.stringify(data),
  })
    .then((response) => {
      if (response.ok) {
        // Registration successful, handle accordingly
        alert("Registration successful!");
      } else {
        // Registration failed, handle accordingly
        alert("Registration failed. Please try again.");
      }

      // Re-enable the signup button
      signupButton.disabled = false;
    })
    .catch((error) => {
      console.error("Error:", error);

      // Re-enable the signup button
      signupButton.disabled = false;
    });
});
},[]);


  return (
    <div className="relative bg-white w-full h-[1024px] overflow-hidden text-left text-11xl text-white font-inter">
        <video autoPlay loop muted className="absolute top-0 left-0 w-full h-full object-cover z-0">
        <source src="/pexels-ekaterina-bolovtsova-6186805 (2160p).mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
      <Navbar />
      <div className="absolute top-[218px] left-[169px] w-[1312px] h-[723px] text-9xl text-darkslategray-100 font-sora">
      <div className="bg-popup bg-gray-100 absolute inset-0 flex shadow-lg left-[260px]">
        <div className="absolute top-[-50px] left-[100px]">
        <b className="absolute top-[100px] left-[80px] text-21xl inline-block text-black w-[181px] h-[49px]">
          SIGNUP
        </b>

        <input className="absolute top-[411px] left-[110px] rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver text-9xl text-darkslategray-100 font-sora"
        type="password"
        id="pass"
        name="pass"
        placeholder="Enter tour Password">
        </input>
          <img
            className="absolute top-[430px] left-[628px]"
            alt=""
            src="/vector5.svg"
          />


        <input
          className="absolute top-[200px] left-[110px] rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver text-9xl text-darkslategray-100 font-sora"
          type="email"
          id="email"
          name="name"
          placeholder="Enter your Email"
        />



        <input className="absolute top-[301px] left-[110px] rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver text-9xl text-darkslategray-100 text-left font-sora"
        type="password"
        id="pass"
        name="pass"
        placeholder="Enter your Password">
        </input>

        <img
          className="absolute top-[320px] left-[625px]"
          alt=""
          src="/vector5.svg"
        />


        <input className="absolute top-[521px] left-[110px] rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver text-9xl text-darkslategray-100 font-sora"
        type="text"
        id="name"
        name="name"
        placeholder="Enter your Name">
        </input>

        <button className="absolute top-[630px] left-[110px] rounded-11xl bg-darkslategray-100 w-[181px] h-[73px]"
        id="signupButton"
        style={{
          textDecoration: "none", // Remove underline
          color: "inherit",
          cursor: "pointer", // Change cursor on hover
        }}
        >
        <div className="absolute top-[17px] left-[32px] text-white text-11xl font-sora">
          Sign up
        </div>

        </button>
        </div>
        </div>
      </div>
    </div>

  );
};



export default SignUpPage;
